import React from "react";
import { Row, Col, Container } from "react-bootstrap";

const LatestAttendance = () => {
  return (
    <>
      <Container className="latest-attendance text-center">
        <h3 style={{ color: "white", textAlign: "left" }}>
          {" "}
          Latest Attendance{" "}
        </h3>
        <Row>
          <Col></Col>
        </Row>
      </Container>
    </>
  );
};

export default LatestAttendance;
